import Layout from '../components/layout/primaryLayout';
import Link from 'next/link';
import { Button, Grid } from '@material-ui/core';

const Home = () => {
	return (
		<Layout>
			<Grid>
				<div>Call For Help</div>
				<Link passHref prefetch href='/ic'>
					<Button color='primary'>IC</Button>
				</Link>
				<Link passHref prefetch href='/maintenance'>
					<Button color='secondary'>Maintenance</Button>
				</Link>
			</Grid>
		</Layout>
	)
}

export default Home
